import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function CdDashboard() {
  const navigate = useNavigate();
  const [selectedDateFrom, setSelectedDateFrom] = useState(new Date().toISOString().slice(0, 10));
  const [selectedDateTo, setSelectedDateTo] = useState(new Date().toISOString().slice(0, 10));
  const [cashDrops, setCashDrops] = useState([]);
  const [cashDrawers, setCashDrawers] = useState([]);
  const [activeDate, setActiveDate] = useState(null); 
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  const denoms = ['hundreds', 'fifties', 'twenties', 'tens', 'fives', 'twos', 'ones', 'half_dollars', 'quarters', 'dimes', 'nickels', 'pennies'];

  // Check login and fetch initial state
  useEffect(() => {
    const checkAuth = async () => {
      const token = localStorage.getItem('access_token');
      if (!token) {
        navigate('/login');
        return;
      }
      setLoading(false);
    };
    checkAuth();
  }, [navigate]);

  const fetchData = async (from, to) => {
    setError('');
    setActiveDate(null);
    try {
      const [dropResponse, drawerResponse] = await Promise.all([
        fetch(`http://localhost:8000/api/cash-drop-app1/cash-drop/?datefrom=${from}&dateto=${to}`, {
          headers: { 'Authorization': `Bearer ${localStorage.getItem('access_token')}` },
        }),
        fetch(`http://localhost:8000/api/cash-drop-app1/cash-drawer/?datefrom=${from}&dateto=${to}`, {
          headers: { 'Authorization': `Bearer ${localStorage.getItem('access_token')}` },
        }),
      ]);

      if (!dropResponse.ok || !drawerResponse.ok) throw new Error('Fetch failed. Check your token or server.');

      const dropData = await dropResponse.json();
      const drawerData = await drawerResponse.json();

      setCashDrops(dropData);
      setCashDrawers(drawerData);

      const allDates = [...new Set([...dropData.map(d => d.date), ...drawerData.map(d => d.date)])].sort().reverse();
      if (allDates.length > 0) setActiveDate(allDates[0]);
    } catch (err) {
      setError(err.message);
    }
  };

  const handleWTD = () => {
    const now = new Date();
    const day = now.getDay();
    const diff = now.getDate() - day + (day === 0 ? -6 : 1); 
    const start = new Date(now.setDate(diff)).toISOString().slice(0, 10);
    const end = new Date().toISOString().slice(0, 10);
    setSelectedDateFrom(start);
    setSelectedDateTo(end);
    fetchData(start, end);
  };

  const handleMTD = () => {
    const start = new Date(new Date().getFullYear(), new Date().getMonth(), 1).toISOString().slice(0, 10);
    const end = new Date().toISOString().slice(0, 10);
    setSelectedDateFrom(start);
    setSelectedDateTo(end);
    fetchData(start, end);
  };

  const handleYTD = () => {
    const start = new Date(new Date().getFullYear(), 0, 1).toISOString().slice(0, 10);
    const end = new Date().toISOString().slice(0, 10);
    setSelectedDateFrom(start);
    setSelectedDateTo(end);
    fetchData(start, end);
  };

  const uniqueDates = [...new Set([...cashDrops.map(d => d.date), ...cashDrawers.map(d => d.date)])].sort().reverse();

  if (loading) return <div className="min-h-screen bg-gray-50 flex items-center justify-center">Loading...</div>;

  return (
    <div className="min-h-screen bg-gray-50 dark:bg-gray-950 p-4 font-sans text-gray-900 dark:text-gray-100">
      <div className="max-w-[1400px] mx-auto bg-white dark:bg-gray-900 rounded-3xl shadow-2xl border border-gray-100 dark:border-gray-800 overflow-hidden">

        {/* Header Section */}
        <div className="p-8 border-b border-gray-50 dark:border-gray-800">
          <div className="flex flex-col md:flex-row justify-between items-center gap-6">
            <h2 className="text-3xl font-black italic tracking-tighter">CASH<span className="text-blue-600">DASHBOARD</span></h2>

            <div className="flex flex-wrap items-end gap-4 bg-gray-50 dark:bg-gray-800/50 p-4 rounded-2xl border border-gray-100 dark:border-gray-700">
              <div className="flex flex-col">
                <label className="text-[10px] font-black text-gray-400 uppercase mb-1">Date From</label>
                <input type="date" value={selectedDateFrom} onChange={e => setSelectedDateFrom(e.target.value)} className="bg-white dark:bg-gray-800 border-none rounded-lg text-sm p-2 focus:ring-2 focus:ring-blue-500" />
              </div>
              <div className="flex flex-col">
                <label className="text-[10px] font-black text-gray-400 uppercase mb-1">Date To</label>
                <input type="date" value={selectedDateTo} onChange={e => setSelectedDateTo(e.target.value)} className="bg-white dark:bg-gray-800 border-none rounded-lg text-sm p-2 focus:ring-2 focus:ring-blue-500" />
              </div>
              <button onClick={() => fetchData(selectedDateFrom, selectedDateTo)} className="bg-blue-600 hover:bg-blue-700 text-white px-6 py-2 rounded-lg font-bold shadow-lg transition-all active:scale-95">Fetch</button>

              <div className="flex gap-1 ml-2">
                <button onClick={handleWTD} className="px-3 py-2 bg-white dark:bg-gray-700 border border-gray-200 dark:border-gray-600 rounded-lg text-[10px] font-black hover:bg-blue-50 transition-colors">WTD</button>
                <button onClick={handleMTD} className="px-3 py-2 bg-white dark:bg-gray-700 border border-gray-200 dark:border-gray-600 rounded-lg text-[10px] font-black hover:bg-blue-50 transition-colors">MTD</button>
                <button onClick={handleYTD} className="px-3 py-2 bg-white dark:bg-gray-700 border border-gray-200 dark:border-gray-600 rounded-lg text-[10px] font-black hover:bg-blue-50 transition-colors">YTD</button>
              </div>
            </div>
          </div>
        </div>

        {error && <div className="m-6 p-4 bg-red-50 text-red-600 rounded-xl border border-red-100 text-center font-bold text-sm">{error}</div>}

        <div className="flex flex-col md:flex-row min-h-[700px]">

          {/* Left Sidebar: Dates */}
          <div className="w-full md:w-60 bg-gray-50/50 dark:bg-gray-900/50 border-r border-gray-50 dark:border-gray-800 p-6">
            <h4 className="text-[10px] font-black text-gray-400 uppercase tracking-widest mb-6 text-center">Reconciliation Log</h4>
            <div className="space-y-2 max-h-[600px] overflow-y-auto pr-2 custom-scrollbar">
              {uniqueDates.map(date => (
                <button
                  key={date}
                  onClick={() => setActiveDate(date)}
                  className={`w-full text-left px-4 py-4 rounded-2xl text-xs font-bold transition-all duration-200 ${
                    activeDate === date 
                    ? 'bg-blue-600 text-white shadow-xl translate-x-1' 
                    : 'bg-white dark:bg-gray-800 text-gray-500 hover:bg-blue-50 border border-gray-100 dark:border-gray-700'
                  }`}
                >
                  {new Date(date).toLocaleDateString(undefined, { month: 'short', day: 'numeric', year: 'numeric' })}
                </button>
              ))}
              {uniqueDates.length === 0 && <p className="text-center text-gray-400 text-xs py-10 italic">No data found</p>}
            </div>
          </div>

          {/* Main Content: Side-by-Side Data */}
          <div className="flex-1 p-8">
            {!activeDate ? (
              <div className="h-full flex flex-col items-center justify-center opacity-20">
                <div className="w-24 h-24 border-4 border-dashed border-gray-300 rounded-full animate-spin-slow mb-4"></div>
                <p className="font-black uppercase tracking-widest text-gray-400">Select Date to Begin</p>
              </div>
            ) : (
              <div className="grid grid-cols-1 lg:grid-cols-2 gap-10 items-start animate-fadeIn">

                {/* COLUMN: CASH DROPS */}
                <div className="flex flex-col gap-6">
                  <div className="flex items-center justify-between border-b-2 border-blue-600 pb-2">
                    <h3 className="text-xl font-black text-gray-800 dark:text-gray-100 uppercase italic">Cash Drops</h3>
                    <span className="text-[10px] font-bold bg-blue-100 text-blue-700 px-2 py-1 rounded">SYSTEM</span>
                  </div>

                  {cashDrops.filter(d => d.date === activeDate).map(drop => (
                    <div key={drop.id} className="flex flex-col min-h-[350px] p-8 bg-white dark:bg-gray-800 rounded-[2.5rem] border border-gray-100 dark:border-gray-700 shadow-sm hover:shadow-md transition-shadow">
                      <div className="flex justify-between items-start mb-6">
                        <div>
                          <span className="text-[10px] font-black bg-blue-50 text-blue-600 px-4 py-1.5 rounded-full uppercase tracking-tighter">Shift {drop.shift_number}</span>
                          <p className="mt-3 text-[11px] font-black text-gray-400 uppercase tracking-widest">Station: {drop.workstation}</p>
                        </div>
                        <div className="text-right">
                           <p className="text-[10px] font-black text-gray-300 uppercase">Total Drop</p>
                           <p className="text-4xl font-black text-blue-600 tracking-tighter">${drop.drop_amount}</p>
                        </div>
                      </div>

                      <div className="text-xs font-bold text-gray-500 mb-6 flex items-center gap-2">
                        <div className="w-1.5 h-1.5 bg-blue-600 rounded-full"></div>
                        Employee: {drop.user_name}
                      </div>

                      {/* Aligned Grid at Bottom */}
                      <div className="grid grid-cols-2 gap-3 mt-auto">
                        {denoms.map(key => drop[key] > 0 && (
                          <div key={key} className="flex justify-between items-center bg-gray-50 dark:bg-gray-900/50 px-4 py-2 rounded-xl border border-gray-100 dark:border-gray-800">
                            <span className="text-[10px] text-gray-400 capitalize">{key.replace('_', ' ')}</span>
                            <span className="text-xs font-black text-gray-800 dark:text-gray-200">{drop[key]}</span>
                          </div>
                        ))}
                      </div>
                    </div>
                  ))}
                </div>

                {/* COLUMN: CASH DRAWERS */}
                <div className="flex flex-col gap-6">
                  <div className="flex items-center justify-between border-b-2 border-emerald-500 pb-2">
                    <h3 className="text-xl font-black text-gray-800 dark:text-gray-100 uppercase italic">Cash Drawers</h3>
                    <span className="text-[10px] font-bold bg-emerald-100 text-emerald-700 px-2 py-1 rounded">PHYSICAL</span>
                  </div>

                  {cashDrawers.filter(d => d.date === activeDate).map(drawer => (
                    <div key={drawer.id} className="flex flex-col min-h-[350px] p-8 bg-white dark:bg-gray-800 rounded-[2.5rem] border border-gray-100 dark:border-gray-700 shadow-sm hover:shadow-md transition-shadow">
                      <div className="flex justify-between items-start mb-6">
                        <div>
                          <span className="text-[10px] font-black bg-emerald-50 text-emerald-600 px-4 py-1.5 rounded-full uppercase tracking-tighter">Station {drawer.workstation}</span>
                          <p className="mt-3 text-[11px] font-black text-gray-400 uppercase tracking-widest">Initial: ${drawer.starting_cash}</p>
                        </div>
                        <div className="text-right">
                           <p className="text-[10px] font-black text-gray-300 uppercase">Drawer Total</p>
                           <p className="text-4xl font-black text-emerald-600 tracking-tighter">${drawer.total_cash}</p>
                        </div>
                      </div>

                      <div className="text-xs font-bold text-gray-500 mb-6 flex items-center gap-2">
                        <div className="w-1.5 h-1.5 bg-emerald-500 rounded-full"></div>
                        Verified: {drawer.user_name}
                      </div>

                      {/* Aligned Grid at Bottom */}
                      <div className="grid grid-cols-2 gap-3 mt-auto">
                        {denoms.map(key => drawer[key] > 0 && (
                          <div key={key} className="flex justify-between items-center bg-gray-50 dark:bg-gray-900/50 px-4 py-2 rounded-xl border border-gray-100 dark:border-gray-800">
                            <span className="text-[10px] text-gray-400 capitalize">{key.replace('_', ' ')}</span>
                            <span className="text-xs font-black text-gray-800 dark:text-gray-200">{drawer[key]}</span>
                          </div>
                        ))}
                      </div>
                    </div>
                  ))}
                </div>

              </div>
            )}
          </div>
        </div>
      </div>

      <style>{`
        .custom-scrollbar::-webkit-scrollbar { width: 4px; }
        .custom-scrollbar::-webkit-scrollbar-thumb { background: #e2e8f0; border-radius: 10px; }
        .dark .custom-scrollbar::-webkit-scrollbar-thumb { background: #334155; }
        @keyframes fadeIn { from { opacity: 0; transform: translateY(10px); } to { opacity: 1; transform: translateY(0); } }
        .animate-fadeIn { animation: fadeIn 0.4s ease forwards; }
        .animate-spin-slow { animation: spin 8s linear infinite; }
        @keyframes spin { from { transform: rotate(0deg); } to { transform: rotate(360deg); } }
      `}</style>
    </div>
  );
}

export default CdDashboard;
